import React, { useState, useEffect} from "react";
import PageTitle from "../components/Typography/PageTitle";
import { Card, CardBody } from "@windmill/react-ui";
import RoundIcon from "../components/RoundIcon";
import { GrTechnology } from "react-icons/gr";
import { FaBook, FaCode, FaDatabase } from "react-icons/fa";
import { SiCoursera } from "react-icons/si";

const curriculum = [
  {
    id: 1,
    icon: FaDatabase,
    name: "Database Management Systems",
    faculty: "John Doe",
  },
  {
    id: 2,
    icon: FaCode,
    name: "Data Structures",
    faculty: "John Doe",
  },
  {
    id: 3,
    icon: FaBook,
    name: "Computer Architecture",
    faculty: "John Doe",
  },
  {
    id: 4,
    icon: GrTechnology,
    name: "Internet Of Things",
    faculty: "John Doe",
  },
];

function Mycourse() {
  const rollno = "7376211CS239";
  const semester = "6";
  const [assignedcoursedata,setAssignedcoursedata] = useState([]);
  useEffect(() => {
    async function fetchData() {
      try {
        const response = await fetch(
          `http://localhost:5555/myassignedcourse/${rollno}/${semester}`
        );
        const data = await response.json();
        const mappedData = data.map((courseassigned) => ({
          coreSubject1: courseassigned.course_name1,
          coreSubject2: courseassigned.course_name2,
          coreSubject3: courseassigned.course_name3,
          coreSubject4: courseassigned.course_name4,
          electivecourse_1: courseassigned.electivecourse_1,
          electivecourse_2: courseassigned.electivecourse_2,
          open_electivecourse: courseassigned.open_electivecourse,
          addon_course: courseassigned.addon_course,
          honoursCourses1: courseassigned.honoursCourses1,
          honoursCourses2: courseassigned.honoursCourses2,
        }));
        setAssignedcoursedata(mappedData);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    }
    fetchData();
  }, []);
console.log(assignedcoursedata);
  return (
    <>
      <PageTitle>My Course</PageTitle>

      <div className="grid gap-6 mb-8 md:grid-cols-2 xl:grid-cols-4">
        {assignedcoursedata.map((course) => (
          <Card key={course.id}>
            <CardBody className="flex flex-col items-center">
              <RoundIcon
                icon={SiCoursera}
                iconColorClass="text-orange-500 dark:text-orange-100"
                bgColorClass="bg-orange-100 dark:bg-orange-500"
                className="mx-auto mb-4"
              />
              <div className="text-center">
                <p className="text-lg font-semibold text-gray-700 dark:text-gray-200">
                  {course.name}
                </p>
              </div>
            </CardBody>
          </Card>
        ))}
      </div>
    </>
  );
}

export default Mycourse;
